  false,\n\t\"url\": null,\n\t\"notes\": \"The Maryland Mortgage Program provides
  help in the form of Down Payment Assistance, as well as a range of Partner Match
  programs from employers, developers and community organizations that can help you
  cover these down payment and closing costs.  These programs may make it possible
  for first-time homebuyers to afford a mortgage when they would not be able to do
  so the conventional way.rnrnDISCLAIMER: Some of the information may be tied to the
  Departmentu2019s bond funded loan programs and should not be relied upon in making
  an investment decision. The Department provides comprehensive quarterly and annual
  financial information and operating data regarding its bonds and bond funded loan
  programs, all of which is posted on the publicly-accessible Electronic Municipal
  Market Access system website (commonly known as EMMA) that is maintained by the
  Municipal Securities Rulemaking Board, and on the Departmentu2019s website under
  Investor Information. The links are: http://www.mdhousing.org/Website/Investor/Default.aspxhttp://emma.msrb.org/\",\n\t\"license_title\":
